class BrokerApp:
    def __init__(self):
        self.submissions: Dict[str, Submission] = {}
        self.users: Dict[str, User] = {}
        self.cached_files: Dict[str, Dict] = {}

    def add_user(self, user: User) -> None:
        self.users[user.user_id] = user

    def create_submission(self, user_id: str, file_type: FileType, content: Dict) -> Optional[Submission]:
        if user_id not in self.users:
            logger.error(f"User {user_id} not found")
            return None
        submission = Submission(str(len(self.submissions) + 1), user_id, file_type, content)
        self.submissions[submission.submission_id] = submission
        logger.info(f"Submission {submission.submission_id} created by user {user_id}")
        return submission

    def get_submission(self, submission_id: str) -> Optional[Submission]:
        return self.submissions.get(submission_id)

    def generate_d_file(self, submission_id: str) -> Optional[Dict]:
        """Generate a D file for a submission if not already cached."""
        if submission_id in self.cached_files:
            return self.cached_files[submission_id]
        submission = self.get_submission(submission_id)
        if not submission:
            return None
        d_file = {"submission_id": submission_id, "data": "Generated D file"}
        self.cached_files[submission_id] = d_file
        return d_file

    def update_flexfields(self, submission_id: str, flexfields: Dict) -> bool:
        """Update flexfields for a submission with performance checks."""
        if len(flexfields) > MAX_FLEXFIELDS:
            logger.warning(f"Flexfields exceed maximum limit of {MAX_FLEXFIELDS}")
            return False
        submission = self.get_submission(submission_id)
        if not submission:
            return False
        submission.content.update(flexfields)
        return True

# Example usage
if __name__ == "__main__":
    broker = BrokerApp()
    user = User("user1", "John Doe", "agency_user")
    broker.add_user(user)

    submission = broker.create_submission("user1", FileType.FABS, {"FundingAgencyCode": "123"})
    if submission:
        submission.publish()

    d_file = broker.generate_d_file("1")
    print(d_file)
